import React from "react";
import ItineraryCard from "../components/ItineraryCard"; // Ensure this path is correct

const Itinerary = ({ itineraries }) => {
  return (
    <div className="p-4">
      <h1 className="text-2xl font-bold mb-4">Your Itinerary</h1>
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-4">
        {itineraries.map((itinerary, index) => (
          <ItineraryCard key={index} itinerary={itinerary} />
        ))}
      </div>
    </div>
  );
};

export default Itinerary;
